import { useState } from "react";

import calendaricon from "../images/calendar_icon.png";

const [inputs, setInputs] = useState({});

function SearchFilter(props) {

    const handleChange = (event) => {

        const name = event.target.value;
        const value = event.target.value
        setInputs(values => ({...values, [name]: value}));
    }

    return(
        <div className="SearchFilter">
            <img src={calendaricon}/>
            <label>Destination<br></br> <input type="text" name="destination" value={inputs.destination} onChange={handleChange}/></label>
            <label>Check in<br></br> <input type="date" name="checkInDate" value={inputs.destination} onChange={handleChange}/></label>
            <label>Check out<br></br> <input type="date" name="checkOutDate" value={inputs.destination} onChange={handleChange}/></label>
            <label>Guests<br></br> <input type="number" name="guests" value={inputs.destination} onChange={handleChange}/></label>
            <label>Check availability<br></br> <button onClick={props.searchHotels}>Check</button></label>
        </div>
    )
}

export default SearchFilter;
// Exporterar komponenten som "SearchFilter".
